import React, { Component } from 'react';
import Card from 'components/cards/cards.jsx';


class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
        coursetypes:[{name:"Computing", desc: "Dummy Description" ,feild: "comp"},{name:"Accounting", desc: "Dummy Description",feild: "acc"},{name:"Health", desc: "Dummy Description", feild: "hel"},{name:"Mechinical", desc: "Dummy Description",feild: "m"}]
        ,user:''
      };
  }    
  

  render() {

    return (
      
      <div className="Home">
        <main className="container">
        <br/>
         { 
         this.state.coursetypes.map((value,id) => {
                    return (
                            <Card key={id} Ctype="btn" data={value}/>
                    )
                })}
        </main>
      </div>
    );
  }
}

export default Home;
